import { Component } from "react";

export class ControlsCounter extends Component {
  render() {
    return (
      <div>
        <button type="button" onClick={this.props.increment}>
          Увеличить на 1
        </button>
        <button type="button" onClick={this.props.decrement}>
          Уменьшить на 1
        </button>
      </div>
    );
  }
}
